import mc from "./input.module.scss";

const InputLogin = ({
  labelContent,
  inputValue,
  inputType,
  handleInputChange,
  handleInputActive,
  handleInputInactive,
  labelUp,
}) => {
  return (
    <div className={mc.container}>
      <label className={labelUp ? `${mc.label} ${mc.labelUp}` : mc.label}>
        {labelContent}
      </label>
      <input
        className={mc.input}
        required={true}
        type={inputType}
        value={inputValue}
        onChange={handleInputChange}
        onFocus={handleInputActive}
        onBlur={handleInputInactive}
      ></input>
    </div>
  );
};

export default InputLogin;
